window.bookSummaryJSON = "<p>A prophecy foretold…the fate of thousands on the line....&nbsp;</p> <p>With one major enemy town behind them, the GreenPiece clan marches onward to new conquests. Facing Oren and his monster army are the combined forces of the so-called \"civilized races\", intent on halting his invasion of their territory.&nbsp;</p> <p>Reality blurs as Oren fights harder than ever to save the trapped players, his clan, and his family. <br> <br> <i>Life Reset: Conquest</i> is book 5 of New Era Online, a LitRPG/GameLit best-selling series that combines settlement development, a monster protagonist, a deranged AI companion who’s obsessed with testicular quips, and a desire to explore what it means to be a human living inside a video game.</p> <p>The Soundbooth Theater team for this production:</p> <p></p> <ul> <li>Jeff Hays - Narration</li> <li>Annie Ellicott - Lirian, Aly, Duladeen</li> <li>Laurie Catherine Winkel - Yulli, Raystia</li> <li>Dalton Lynne - Proofing</li> <li>Ahmed Mahmoud - Sound design</li> <li>Aaron J. Morton - Music composition, production, and performance</li> <li>Agustin Jacob - Editing and mastering</li> </ul>"; 
